Generalmente il termine battaglia, derivato dal latino battualia ("scherma di gladiatori e di soldati"), indica un combattimento fra due o più parti organizzate militarmente che cercano di avere ragione l'una delle altre durante una guerra o una campagna ed è un mezzo per sviluppare una più vasta strategia militare, il significato del termine è stato traslato anche come uno scontro verbale o filosofico, dovuto ad ideologie opposte.Nel Medioevo, il termine battaglia venne utilizzato per indicare un reparto di armati, definizione che col passare del tempo si trasformò in battaglione. Nell'ambito delle traslazioni di significato si individuano: 
* Battaglia legale, scontro in tribunale; 
* Battaglia di civiltà o di morale o filosofica, ecc. scontro verbale di ideologie e vedute diverse In campo europeo già Raimondo Montecuccoli e successivamente Carl von Clausewitz sostenevano che per raggiungere scopi strategici è essenziale l'impiego di battaglie.
